// https://leetcode.com/problems/merge-operations-to-turn-array-into-a-palindrome/
// Medium

class Solution {
public:
    int minimumOperations(vector<int>& nums) {
        int l=0, r=nums.size()-1;
        int sums = 0;
        while (l < r) {
            if (nums[l] == nums[r]) {
                ++l;
                --r;
            } else if (nums[l] < nums[r]) {
                nums[r] -= nums[l];
                ++l;
                ++sums;
            } else {
                nums[l] -= nums[r];
                --r;
                ++sums;
            }
        }
        return sums;
    }
};

class SolutionWithOverflow {
public:
    int minimumOperations(vector<int>& nums) {
        int l=0, r=nums.size()-1;
        int sums = 0;
        while (l < r) {
            if (nums[l] == nums[r]) {
                ++l;
                --r;
            } else if (nums[l] < nums[r]) {
                nums[l+1] += nums[l];
                ++l;
                ++sums;
            } else {
                nums[r-1] += nums[r];
                --r;
                ++sums;
            }
        }
        return sums;
    }
};

